window.bookSummaryJSON = "<p>With Declan O'Carroll on Fairie and Chris Gordon on Earth, what could go wrong? Try everything. Scheming elves, deadly zombies, killer goblins, flaming dragons, and dirty diapers. With a growing, insidious threat to Earth, Chris and Tanya race to save lives while Declan, Stacia, and friends work just as hard to save their own lives on an alien world, far removed from the comforts and safety of home. Only together will they overcome the odds. But, come on, with this team, maybe the odds should look out. </p>"; 
